Giants with Mud Feet

Nature Documentary with no narration published by COM4HD in 2011 - English language


Information
------------------------------

The documentary joins the race against time for a group of American and European scientists as they struggle to save the plight of the proud, towering elm tree from its tiny and terrible enemy. DUTCH ELM DISEASE is a disease caused by a fungus, which is spread by the elm bark beetle. Although believed to be originally native to Asia, the disease has been accidentally introduced into America and Europe, where it has devastated native populations of elms which had not had the opportunity to evolve resistance to the disease. The elm's existence is threatened by a creature whose microscopic size contrasts with the giant size of its victim.

